import QuoteForm from "../components/quotes/QuoteForm";

const NewQuote = () => {
    const QuoteAddHandler = (data) => {
        console.log( data );
        history.push( "/quotes" );
    }

    return <QuoteForm onAddQuote={QuoteAddHandler} />
};

export default NewQuote;
